import { SiLinkedin, SiInstagram } from 'react-icons/si';

export default () => {
	return (
		<div className="monkeyCard">
			<div className="monkeyDrawing"></div>
			<div className="monkeyInfo">
				<div className="monkeyText">
					<p>LORD</p>
					<h2>Co-Founder</h2>
				</div>
				<div className="monkeyIcons">
					<a href="">
						<SiInstagram />
					</a>
					<a href="">
						<SiLinkedin />
					</a>
				</div>
			</div>
		</div>
	);
};
